function I = fcnK1C(S, t, u, alpha, F, tol)
t2 = sqrt(-alpha);t3 = t2 ./ alpha;t4 = S .* alpha;t5 = -t4 + u;t6 = 0.1e1 ./ t5;t7 = F - t2;t8 = 0.1e1 ./ t7;t10 = t7 .^ 2;t12 = t2 .* S;t13 = t7 .* t12;t16 = sqrt(t10 .* S + 0.2e1 .* t13 - t4 + u);t17 = 0.1e1 ./ t16;t21 = t5 .^ 2;t22 = 0.1e1 ./ t21;t23 = t22 .* S;t26 = S .^ 2;t28 = t22 .* t26 .* t2;t29 = 0.1e1 ./ u;t30 = t17 .* t29;t34 = sqrt(t5);t37 = 0.1e1 ./ t34 ./ t21 .* S;t41 = log(0.2e1 .* t8 .* (t16 .* t34 + t13 - t4 + u));t44 = t6 .* t3;t45 = F .* S;t49 = F + t2;t50 = 0.1e1 ./ t49;t52 = t49 .^ 2;t54 = t49 .* t12;t57 = sqrt(t52 .* S - t4 - 0.2e1 .* t54 + u);t58 = 0.1e1 ./ t57;t64 = t58 .* t29;t71 = log(0.2e1 .* t50 .* (t57 .* t34 - t4 - t54 + u));t77 = t17 .* t8 .* t6 .* t3 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t17 .* t23 + 0.3e1 ./ 0.4e1 .* F .* t30 .* t28 + 0.3e1 ./ 0.4e1 .* t41 .* t37 + t45 .* t30 .* t44 ./ 0.2e1 - t58 .* t50 .* t6 .* t3 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t58 .* t23 - 0.3e1 ./ 0.4e1 .* F .* t64 .* t28 + 0.3e1 ./ 0.4e1 .* t71 .* t37 - t45 .* t64 .* t44 ./ 0.2e1;
I = t77(:,:,2) - t77(:,:,1);

end
